import React, { useEffect, useState } from "react";
import Navbar from "../../components/Navbar";
import {
    getAllRecords,
    searchRecords,
    filterByDate
} from "../../services/medicalRecordService";
import "../../styles/patient/medical-records.css";

function MedicalRecords() {

    const [records, setRecords] = useState([]);
    const [searchText, setSearchText] = useState("");
    const [selectedDate, setSelectedDate] = useState("");
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchAllRecords();
    }, []);

    const fetchAllRecords = async () => {
        try {
            const data = await getAllRecords();
            setRecords(data);
        } catch (error) {
            console.error("Error loading records");
        } finally {
            setLoading(false);
        }
    };

    const handleSearch = async () => {
        if (!searchText) return fetchAllRecords();

        try {
            const data = await searchRecords(searchText);
            setRecords(data);
        } catch (error) {
            console.error("Search failed");
        }
    };

    const handleDateChange = async (date) => {
        setSelectedDate(date);

        if (!date) return fetchAllRecords();

        try {
            const data = await filterByDate(date);
            setRecords(data);
        } catch (error) {
            console.error("Date filter failed");
        }
    };

    return (
        <>
            <Navbar />

            <div className="page-content">
                <div className="records-wrapper container-fluid">

                    <h1>Medical Records</h1>

                    <div className="card p-3 shadow-sm mt-3">
                        <div className="row g-2">
                            <div className="col-md-10">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="Search..."
                                    value={searchText}
                                    onChange={(e) => setSearchText(e.target.value)}
                                />
                            </div>

                            <div className="col-md-2 d-grid">
                                <button className="btn btn-primary" onClick={handleSearch}>
                                    Search
                                </button>
                            </div>
                        </div>
                    </div>

                    <div className="row mt-3">
                        <div className="col-md-4 ms-auto">
                            <input
                                type="date"
                                className="form-control"
                                value={selectedDate}
                                onChange={(e) => handleDateChange(e.target.value)}
                            />
                        </div>
                    </div>

                    <div className="table-responsive mt-4">
                        <table className="table table-bordered record-table">

                            <thead>
                                <tr>
                                    <th>ID</th>
                                    <th>Patient</th>
                                    <th>Symptoms</th>
                                    <th>Diagnosis</th>
                                    <th>Prescription</th>
                                    <th>Date</th>
                                </tr>
                            </thead>

                            <tbody>
                                {loading ? (
                                    <tr>
                                        <td colSpan="6" className="text-center">
                                            Loading records...
                                        </td>
                                    </tr>
                                ) : records.length === 0 ? (
                                    <tr>
                                        <td colSpan="6" className="text-center text-danger">
                                            No records found
                                        </td>
                                    </tr>
                                ) : (
                                    records.map((r) => (
                                        <tr key={r.id}>
                                            <td>{r.id}</td>
                                            <td>{r.patientName}</td>
                                            <td>{r.symptoms}</td>
                                            <td>{r.diagnosis}</td>
                                            <td>{r.prescription}</td>
                                            <td>
                                                {new Date(r.date).toLocaleDateString()}
                                            </td>
                                        </tr>
                                    ))
                                )}
                            </tbody>

                        </table>
                    </div>

                </div>
            </div>
        </>
    );
}

export default MedicalRecords;
